INSERT INTO `app_detail` (`app_id`, `app_desc`) VALUES
(1, '&lt;p&gt;&lt;strong&gt;&amp;quot;સમાજ સેતુ&amp;quot; થી સમાજ વિકાસ ની ભવ્ય વિશ્વસનીય પરંપરા&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;એક દસકા અગાઉ વર્ષ 2008 માં જાકાશણા ખાતે યોજાયેલ આપણાં 72 સમાજ ની જનરલ મિટિંગમાં પેન્ફ્લેટ વિતરણ અને ત્યાં આપેલ જાહેર વક્તવ્ય થી SMS GupShup દ્વારા મળતી ફ્રી SMS&lt;/p&gt;\n\n&lt;p&gt;ની સેવાથી આપણાં 72 સમાજ માં એ સમયે&lt;br /&gt;\nસમાજ વિકાસ,&lt;br /&gt;\nનોકરી - બીઝનેસ,&lt;br /&gt;\nરોજ એક લગ્ન સંબંધ નો બાયોડેટા,&lt;br /&gt;\nબેશણા&amp;nbsp; ની માહિતી&lt;br /&gt;\nઅને બીજા અનેક ઉપયોગી&lt;br /&gt;\nસાદા મેસેજ થી શરુ થયેલી માહિતી ના માધ્યમ થી સમાજ વિકાસ ની ભવ્ય પરંપરા...&lt;/p&gt;\n\n&lt;p&gt;પછી આપ સૌ ના સહકાર થી 20,ફેબ્રુઆરી 2018 માં શરુ થયેલ&lt;br /&gt;\n&amp;quot;સમાજ સેતુ&amp;quot; ના વોટસએપ ગ્રુપ દ્વારા સમાજ વિકાસ ની ડિજિટલ યાત્રા હવે...&lt;/p&gt;\n\n&lt;p&gt;&amp;quot;સમાજ સેતુ&amp;quot; મોબાઈલ એપ્લિકેશન સુધી પહોંચી છે.&lt;/p&gt;\n\n&lt;p&gt;&lt;u&gt;&lt;em&gt;&lt;strong&gt;SMS GupShup&lt;/strong&gt;&lt;/em&gt;&lt;/u&gt;&lt;br /&gt;\nઅને&lt;br /&gt;\n&amp;quot;સમાજ સેતુ&amp;quot; વોટ્સએપ ગ્રૂપ ની સેવા ને સૌ એ ખૂબ વખાણી.&lt;br /&gt;\nજોબ અને લગ્ન સંબંધ ની માહિતી થી કેટલાય પરિવાર માં ખુશીઓ છવાઈ છે...એનો આનંદ જ અમને નવા કદમ ઉઠાવવા નું બળ આપે છે.&lt;/p&gt;\n\n&lt;p&gt;હવે &amp;quot;સમાજ સેતુ&amp;quot; મોબાઈલ એપ્લિકેશન પણ દૂર દૂર અને વિદેશ વસતાં આપણાં પરિવારો વચ્ચે &amp;quot;સેતુ&amp;quot; બનશે એવો અમને દ્રઢ વિશ્વાસ છે.&lt;/p&gt;\n\n&lt;p&gt;&amp;quot;સમાજ સેતુ&amp;quot; મોબાઈલ એપ્લિકેશન અનેક નવીન અને વધુ સર્વાંગી ઉચ્ચ સેવા પ્રદાન કરશે.&lt;br /&gt;\nજાહેરાત ની આવક થી વિદ્યાર્થી કારકિર્દી માર્ગદર્શન સેમીનાર,વિદેશ જવા ઇચ્છુક વિદ્યાર્થી માર્ગદર્શન સેમિનાર અને સમૂહલગ્ન માં દાન આપવામાં આવશે.&lt;br /&gt;\nફક્ત ઓનલાઇન પેટીએમ દ્વારા જ આર્થિક વ્યવહાર થશે એને સૌ રોજ જોઈ શકશે જ એવી ખાસ એપ્લિકેશન માં વ્યવસ્થા રાખી છે.&lt;br /&gt;\nઆર્થિક પારદર્શકતા નું ખાસ ધ્યાન રાખવામાં આવ્યું છે.&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&amp;quot;સમાજ સેતુ&amp;quot; ચોક્કસ &amp;quot;સંપર્ક સેતુ&amp;quot; પણ બનશે જ.&lt;/p&gt;\n\n&lt;p&gt;સમાજ માં આત્મીયતા,ભાઈચારો અને સહકાર ની ઉમદા ભાવના સાથે &amp;quot;સૌ નો સાથ સૌ નો વિકાસ&amp;quot; થશે.&lt;/p&gt;\n\n&lt;p&gt;આપણે સામાજિક,આર્થિક અને રાજકીય વિકાસ ના શિખરો સર કરીશું.&lt;br /&gt;\nઆવો આપણે સૌ હકારાત્મક અભિગમ થી સાથે મળી વિકાસ ની ઊંચી ઉડાન ભરીએ.&lt;/p&gt;\n\n&lt;p&gt;આભાર...&lt;/p&gt;\n');
