INSERT INTO `event_details` (`event_id`, `event_title`, `event_photo`, `event_content`, `event_date`, `event_time`, `event_place`, `event_attachment`) VALUES
(2, 'જનરલ મિટિંગ', '1556883552568.jpg', '&lt;p&gt;આપણાં 72 સમાજ ની દરવર્ષે યોજાતી પરંપરાગત જનરલ મીટીંગ&lt;/p&gt;\n\n&lt;p&gt;તારીખ :- 04/05/2019,શનિવાર,સાંજ થી મોડી રાત સુધી&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;*મદ્રીશણા તા - દેત્રોજ,જિલ્લો - અમદાવાદ* મુકામે ખૂબ ઉત્સાહ અને શિસ્ત પૂર્વક યોજાશે.&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;આવો,આપણે સૌ સાથે મળી નક્કર વિકાસ ની દિશા માં ચિંતન કરી ઠોશ કદમ ઉઠાવીએ.&lt;/p&gt;\n', '2019-05-04', '7:00 PM', ' મદ્રીશણા', ''),
(3, 'સમગ્ર ગુજરાત પાટીદાર ભૂત પરિવાર જનરલ મિટિંગ', '1563196260375.jpg', '&lt;p&gt;આપણો સમાજ...&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;આપણું ગૌરવ...&lt;/p&gt;\n\n&lt;p&gt;*સમાજ સેતુ* ???? *98250 76415*&lt;br /&gt;\n~~~~~~~~~~~~~~~~~~~~&lt;/p&gt;\n\n&lt;p&gt;*સમગ્ર પાટીદાર ભૂત પરિવાર સ્નેહ સંમેલન*&lt;/p&gt;\n\n&lt;p&gt;આપણાં સમાજ ના ભૂત પરિવાર આપના ધ્યાનમાં હોય એ પરિવારો ને આ મેસેજ અચૂક મોકલશોજી.&lt;/p&gt;\n', '2019-07-28', '10:00 AM', 'અયોધ્યા ધામ,રામજી મંદિર,મહાદેવનગર ટેકરા,અમદાવાદ', ''),
(4, 'શ્રી ઉમિયા માતાજી સંસ્થાન ઊંઝા દ્વારા લક્ષચંડી મહાયજ્ઞ નું ભવ્ય આયોજન', '1563553270712.jpg', '&lt;p&gt;જગત જનની માં ઉમિયા જી,ઊંઝા ના દ્વારે વિશ્વનો તૃતીય સૌથી મોટો લક્ષચંડી મહાયજ્ઞ 18/12/2019 થી 22/12/2019 સુધી ભવ્ય આયોજન છે.&lt;/p&gt;\n\n&lt;p&gt;પવિત્ર ધાર્મિક માહોલ સાથે પાટીદાર સંગઠન દ્વારા સામાજિક &amp;amp; આર્થિક ચેતનાનું કેન્દ્ર બની રહેશે.&lt;/p&gt;\n\n&lt;p&gt;કુલ 800 વીઘા જમીન ના વિશાળ સંકુલમાં 51 વીઘા જમીનમાં 81 ફૂટ ઊંચો યજ્ઞ મંડપ બનશે.80 થી 90 લાખ દર્શનાર્થીઓ આ ભવ્ય યજ્ઞનો લાભ લેશે.&lt;/p&gt;\n\n&lt;p&gt;800 વીઘા જમીન દરેક જ્ઞાતિના ખેડૂતોએ અત્યારથી વિનામૂલ્યે આ કાર્યક્રમ માટે આપી પણ દીધી,પ્રાથમિક સગવડ ના ભાગ રૂપે વિશાળ રોડ બનવાનુ ચાલુ પણ થઈ ગયું.&lt;/p&gt;\n\n&lt;p&gt;ઉત્સાહી ખંતીલા સ્વયં સેવકો ની ટીમ ગામે ગામથી બનવા લાગી.&lt;/p&gt;\n\n&lt;p&gt;કર્મઠ કાર્યકર્તાઓ ની મોટી ફોજ આ ભવ્ય કાર્યક્રમને સફળ બનાવવા તન, મન અને ધનથી લાગી ગઈ છે.&lt;/p&gt;\n\n&lt;p&gt;પાટીદાર ત્યાં પત્રિકા પહોંચશે.&lt;/p&gt;\n\n&lt;p&gt;માં ઉમિયા નો આ ભવ્યાતિભવ્ય મહોત્સવ આપણા જીવનનો અમૂલ્ય લ્હાવો બની રહેશે.&lt;/p&gt;\n', '2019-12-18', '8:00 AM', 'ઊંઝા,ઐઠોર રોડ', ''),
(5, 'આગામી સમૂહ લગ્નોત્સવ નું આયોજન જાન્યુઆરી 2020', '1570977766363.jpg', '&lt;p&gt;આગામી સમૂહ લગ્નોત્સવ નું આયોજન જાન્યુઆરી 2020&lt;/p&gt;\n', '2020-01-30', '8:00 AM', 'મુ. - દેવગઢ, તા. - બહુચરાજી, જિલ્લો - મહેસાણા', '');
