(29, 'Moteeram Punjdas Patel', 'મોતીરામ પંજદાસ પટેલ', 666, 'patel', '2019-10-15', 'મંગળવાર', '2019-10-17', 'ગુરુવાર', '8:0', '', '2019-10-20', 'રવિવાર', '8:00', '', '', 66, '1571239748168.jpg', '&lt;p&gt;&lt;strong&gt;પૂજ્ય મોતીરામ પંજદાસ પટેલ&lt;/strong&gt;&lt;br /&gt;\nઓઢવ&lt;br /&gt;\n&lt;br /&gt;\nતારીખ 15/10/2019, મંગળવારનો રોજ દુઃખદ અવસાન થયેલ છે.&lt;br /&gt;\n&lt;br /&gt;\nપરમ કૃપાળુ પરમાત્મા સદગતના આત્માને દિવ્ય શાંતિ અર્પે....&lt;br /&gt;\n&lt;br /&gt;\n&lt;strong&gt;સદગત નું બેસણું :-&lt;/strong&gt;&lt;br /&gt;\nતારીખ: 17/10/2019 (ગુરુવાર)&lt;br /&gt;\nસમય: 8:00 - 11:00&lt;br /&gt;\nસ્થળ: Gam: Odhav, Ta: Detroj&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;સદગત નું બીજું&lt;/strong&gt;&amp;nbsp;&lt;strong&gt;બેસણું :-&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;તારીખ: 20/10/2019 (રવિવાર)&lt;/p&gt;\n\n&lt;p&gt;સમય: 8:00 - 11:00&lt;/p&gt;\n\n&lt;p&gt;સ્થળ: માણેક સ્મૃતિ હોલ રાધા સ્વામી રોડ, રાણીપ, અમદાવાદ&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;br /&gt;\nલિ..&lt;br /&gt;\n&lt;br /&gt;\nશ્રી રામ જય રામ જય જય રામ...&lt;br /&gt;\nશ્રી રામ જય રામ જય જય રામ...&lt;/p&gt;\n', 1, 1),
(33, 'Gangarambhai Prahladdas Patel', 'ગંગારામભાઇ પ્રહલાદદાસ પટેલ', 1191, 'Rudatala', '2019-11-17', 'રવિવાર', '2019-11-21', 'ગુરુવાર', '8:0', '', '1970-01-01', '', '', '', 'Li\nManibhai Prahladdas Patel\nRambhai Prahladdas Patel\nAmbalal Prahladdas Patel\nRasikbhai Virchanddas Patel', 70, '1574136633319.jpg', '&lt;p&gt;&lt;strong&gt;પૂજ્ય પૂજય પટેલ ગંગારામભાઇ પ્રહલાદદાસ પટે&lt;/strong&gt;&lt;br /&gt;\nરૂદાતલ&lt;br /&gt;\n&lt;br /&gt;\nતારીખ 17/11/2019, રવિવારનો રોજ દુઃખદ અવસાન થયેલ છે.&lt;br /&gt;\n&lt;br /&gt;\nપરમ કૃપાળુ પરમાત્મા સદગતના આત્માને દિવ્ય શાંતિ અર્પે....&lt;br /&gt;\n&lt;br /&gt;\n&lt;strong&gt;સદગત નું બેસણું :-&lt;/strong&gt;&lt;br /&gt;\nતારીખ: 21/11/2019 (ગુરુવાર)&lt;br /&gt;\nસમય: 8:0&lt;br /&gt;\nસ્થળ: Rudatal Ta - Detroj-Rampura Dist - Ahmedabad&lt;br /&gt;\n&lt;br /&gt;\nલિ..&lt;br /&gt;\nLi Manibhai Prahladdas Patel Rambhai Prahladdas Patel Ambalal Prahladdas Patel Rasikbhai Virchanddas Patel&lt;br /&gt;\n&lt;br /&gt;\nશ્રી રામ જય રામ જય જય રામ...&lt;br /&gt;\nશ્રી રામ જય રામ જય જય રામ...&lt;/p&gt;\n', 1, 1),
