INSERT INTO `news_details` (`news_id`, `post_title`, `post_date`, `post_content`, `post_attachment`, `post_photo`) VALUES
(1, 'બીન અનામત આયોગ દ્વારા બિઝનેસ માટે મળતી ઓછા વ્યાજ ની લોન ની માહિતી', '2019-07-09', '&lt;p&gt;બીન અનામત આયોગ દ્વારા સવર્ણ જ્ઞાતિઓ ને બિઝનેસ માટે મળતી ઓછા વ્યાજ ની લોન સહાય.&lt;/p&gt;\n', '', '1562649537703.jpg'),
(2, 'કેન્સર - પથરી - ડાયાબિટીસ ના દર્દ મટે નાસિક પાસે સેવા ના આશય થી ચાલતી સંસ્થા', '2019-07-09', '&lt;p&gt;આ વિગત ત્યાં ગયેલ મિત્રો ના અનુભવથી મુકેલ છે.&lt;/p&gt;\n\n&lt;p&gt;છતાં ત્યાં જતા પહેલાં યોગ્ય તપાસ કરીને જ જવું.&lt;/p&gt;\n\n&lt;p&gt;સમાજ સેતુ માં માહિતી માટે જ મુકેલ છે.&lt;/p&gt;\n', '', '1562692717882.jpg'),
(3, 'પાટીદાર ઇતિહાસ ગાથા', '2019-07-12', '&lt;p&gt;#પાટીદાર_સંતો:-&lt;br /&gt;\nપાટીદારોએ અનેક સંતો આપ્યા છે. મહારાષ્ટ્રના સંત તુકારામ કણબી હતા.તુકારામનો જન્મ ઈ.સ.૧૫૬૮ મા પુના પાસે કણબી બાલોજીના ઘરે થયો હતો.&lt;br /&gt;\nકચ્છના સંત અબજીબાપા પણ પાટીદાર પુત્ર હતા.ભગવાન સહજાનદ સ્વામીએ કચ્છમા પણ વિચરણ કર્યુ હતુ.&lt;br /&gt;\nસદગુરુ શાસ્ત્રી ધર્મજીવનદાસ સ્વામી&lt;br /&gt;\nપણ પાટીદાર જ્ઞાતિમા જનમ્યા હતા.&lt;br /&gt;\nસૌરાષ્ટ્રના સંત ભોજા ભગત પણ પાટીદાર પરિવારના પુત્ર હતા.&lt;br /&gt;\nકચ્છના ખેતાબાપા પણ કણબી પરિવારમા જનમ્યા હતા.&lt;br /&gt;\nઅક્ષર પુરૂષોત્તમ સંસ્થાના સર્વસર્વા પુ.&lt;br /&gt;\nપ્રમુખ સ્વામી અને શ્રી મણીનગર ગાદીના શ્રી પૂરૂષોતમપ્રિયદાસજી પણ&lt;br /&gt;\nપાટીદાર પરિવારથી હતા.&lt;br /&gt;\nભૂજના અક્ષરજીવનદાસ સ્વામી પણ&lt;br /&gt;\nપાટીદાર પરિવારથી હતા.&lt;br /&gt;\nજૈનમુનિ બુધ્ધિસાગરજીનો જન્મ ઇ.સ.૧૮૭૬ મા વિજાપુરના પાટીદાર પરિવારમા થયો હતો.&lt;br /&gt;\nપન્નાલાલ પટેલ,દેવેન્દ્ર પટેલ જેવા લેખકો અને અખબાર ક્ષેત્રે ખાસ પ્રતિભાશાળી સંદેશના આદ્યતંત્રી શ્રી ચિમનભાઈ પટેલ પણ પાટીદાર છે.&lt;br /&gt;\nસંકલન:-#પોપટભાઈ_પટેલ_ઘેલડા...&lt;/p&gt;\n', '', 'no_news.jpg'),
(4, 'સરકારી યોજનાઓ નો લાભ લેવા જરૂરી પ્રમાણપત્ર કઢાવવા જરૂરી ડોક્યુમેન્ટ ની ઉપયોગી યાદી', '2019-07-28', '&lt;p&gt;સરકારી યોજનાઓ નો લાભ લેવા રોજિંદા વ્યવહારમાં કઢાવવા પડતા સરકારી પ્રમાણપત્ર માટે કયા કયા ડોક્યુમેન્ટ લઈ જવા પડે એની યાદી જે કાયમી ઉપયોગી થશે&lt;/p&gt;\n', '', '1564325569511.jpg'),
(5, 'કમનસીબે અકસ્માત થાય તો સરકાર દ્વારા 50,000/- સહાય', '2019-07-28', '&lt;p&gt;કમનસીબે અકસ્માત થાય તો સરકાર તરફથી સારવાર માટે રૂ.50,000/- ની સહાય મેળવવા માટે જરૂરી પ્રક્રિયા.&lt;/p&gt;\n\n&lt;div&gt;આ સમાજ સેતુ મોબાઈલ એપ માં કાયમી રહેશે જે ધ્યાન માં રાખશો,કોઈને મદદ રૂપ થશે.&lt;/div&gt;\n', '', '1564334399213.png');
INSERT INTO `organization_details` (`org_id`, `org_name`, `org_photo`, `org_details`) VALUES
(1, 'શ્રી 72 ચુંવાળ પાટીદાર પ્રગતિ મંડળ - કડી', 'no_img.png', '&lt;p&gt;કડી પ્રગતિ મંડળ&lt;/p&gt;\n'),
(2, 'શ્રી 72 ચુંવાળ પાટીદાર પ્રગતિ મંડળ - મહેસાણા', '1563802969282.png', '&lt;p&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;72 ચુંવાળ પાટીદાર સમાજ ના મહેસાણા માં વસતાં પરિવારો ના સભ્યો ના સામાજિક અને શૈક્ષણિક વિકાસ માટે કામ કરતી સંસ્થા છે.&lt;br /&gt;\nહાલ 400 થી વધુ પરિવાર સભ્ય બનેલા છે.&lt;br /&gt;\nમહેસાણા પ્રગતિ મંડળ નું વર્ષ 2007 થી પોતાનું પૂજન કોમ્પલેક્ષ,મોઢેરા રોડ ઉપર 600 ચો.ફૂટ નું સંપૂર્ણ સુવિધા સજ્જ કાર્યાલય છે.&lt;br /&gt;\nમહેસાણા પ્રગતિ મંડળ નાં સભ્યો દ્વારા 22 વર્ષથી (1997) સંચાલિત બહુચર ક્રેડિટ સોસાયટી પણ છે.જેમાં 1650 સભાસદ છે. કુલ 5 કરોડ 90 લાખ નું હાલ ધિરાણ કરેલ છે.&lt;/p&gt;\n'),
(3, 'શ્રી 72 ચુંવાળ પાટીદાર પ્રગતિ મંડળ - અમદાવાદ', 'no_img.png', '&lt;p&gt;શ્રી 72 ચુંવાળ પાટીદાર પ્રગતિ મંડળ - અમદાવાદ&lt;/p&gt;\n'),
(4, 'શ્રી ઉમિયા એજ્યુકેશન ટ્રસ્ટ', 'no_img.png', '&lt;p&gt;શ્રી ઉમિયા એજ્યુકેશન ટ્રસ્ટ&lt;/p&gt;\n');
