INSERT INTO `proud_details` (`pr_id`, `prc_id`, `full_name`, `village_id`, `photo_list`, `post_attachment`, `proud_details`) VALUES
(2, 1, 'SHRI CHANDUBHAI GANESHDAS PATEL', 68, '[\"1562725961776.jpg\"]', '', '&lt;div&gt;પાટીદાર રત્ન એવા *શ્રી ચંદુભાઈ ગણેશદાસ પટેલ* પ્રતાપનગર ને &amp;ldquo;Indian Council of Society Welfare(Gujarat State)&amp;rdquo; તરફથી **ગ્લોરી ઓફ ગુજરાત એવોર્ડ ૨૦૧૮ **મહામહીમ ગવર્નર ઓફ ગુજરાત *શ્રી ઓ. પી. કોહલીજી* ના વરદ હસ્તે આજ રોજ રાજભવન ગાંધીનગર ખાતે એનાયત થયો.&amp;nbsp;&lt;/div&gt;\n\n&lt;div&gt;&amp;nbsp;&lt;/div&gt;\n\n&lt;div&gt;આ અગાઉ પણ તેઓ&lt;/div&gt;\n\n&lt;div&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; *ગુજરાત ગૌરવ એવોર્ડ*&lt;/div&gt;\n\n&lt;div&gt;*ધરતી રત્ન એવોર્ડ*&lt;/div&gt;\n\n&lt;div&gt;*બેસ્ટ બેન્ક લીંકેજિંગ એવોર્ડ(NGO)*&lt;/div&gt;\n\n&lt;div&gt;*બેસ્ટ પર્ફોમન્સ એવોર્ડ (NGO)*&lt;/div&gt;\n\n&lt;div&gt;*NGO લર્નિંગ એવોર્ડ*&lt;/div&gt;\n\n&lt;div&gt;*રક્તપિત્ત સેવા એવોર્ડ(NGO)*&lt;/div&gt;\n\n&lt;div&gt;સમાજસેવા સન્માનપત્ર&lt;/div&gt;\n\n&lt;div&gt;એવોર્ડથી સન્માનીત થયેલ છે.&lt;/div&gt;\n\n&lt;div&gt;&amp;nbsp;&lt;/div&gt;\n\n&lt;div&gt;તેમણે MSW &amp;amp; LLB નો અભ્યાસક્રમ પૂર્ણ કરી ૧૯૯૦થી ચુંવાળ ગ્રામ વિકાસ ટ્રસ્ટના પ્રમુખ તરીકે સમાજ સેવાના કાર્યોની શરૂઆત કરી હાલમાં ગુજરાતનાં ૪ જીલ્લાના ૩૦૦ ગામડામાં સંસ્થા અનેક સેવાકાર્યની પ્રવૃત્તિ કરે છે.&lt;/div&gt;\n\n&lt;div&gt;તેમજ તેઓ ૭૦ NGO સાથે સંકળાયેલા છે હાલમાં&amp;nbsp; સોલા &amp;ldquo;શ્રી ઉમિયા કેવીસી એજ્યુકેશન ટ્રસ્ટ&amp;rdquo; માં મહામંત્રી તરીકે માનદ સેવા આપે છે.&lt;/div&gt;\n'),
(3, 2, 'SHRI RAJESHKUMAR TRIBHOVANDAS PATEL', 13, '[\"1563013176729.jpg\"]', '', '&lt;p&gt;મૂળ બરિયફ ના વતની અને હાલ સુરત સ્થાઈ શ્રી રાજેશકુમાર ત્રિભોવનદાસ પટેલ ને ભારત સરકાર દ્વારા ઉત્પાદનમાં વિશેષ યોગદાન બદલ શ્રમશ્રી એવોર્ડ થી તત્કાલીન વડાપ્રધાન મનમોહનસિંહ &amp;amp; કેન્દ્રીય પ્રધાન ખડગેજી ના વરદ હસ્તે એવોર્ડ થી સન્માનિત કરવામાં આવ્યા હતા.&lt;/p&gt;\n\n&lt;div&gt;સમાજ નું ગૌરવ વધારવા બદલ ધન્યવાદ...&lt;/div&gt;\n'),
(4, 4, 'SHRI NARESHBHAI & SHRI RAJUBHAI PATEL', 81, '[\"1571045640307.jpg\"]', '', '&lt;p&gt;*&lt;strong&gt;આપણાં 72 સમાજ નું ગૌરવ&lt;/strong&gt;*&lt;/p&gt;\n\n&lt;p&gt;સર્વ વડીલો ના આર્શીવાદ થી ઇન્ડિયા બુક ઓફ રેકોર્ડ દ્વારા 1000 થી વધુ વડીલો ને&amp;nbsp; હરિદ્વાર યાત્રા કરાવવા બદલ નરેશભાઈ ને અને રાજુભાઇ (સીતાપુર) ને એવોર્ડ આપવામાં આવ્યો છે .&lt;/p&gt;\n\n&lt;p&gt;*&lt;strong&gt;ઈન્ડિયા બુક ઓફ રેકોર્ડ&lt;/strong&gt;* ની આગામી પબ્લિક થનાર બુક માં બોતેર સમાજ ના વડીલો માટેની હરિદ્વાર યાત્રા ની માહિતી આવશે અને બોતેર સમાજ નું નામ બુક માં ચમકશે .&lt;/p&gt;\n');
