(2, 74, '1556390890123.jpeg', '&lt;p&gt;રાંતેજ તીર્થનો ઇતિહાસ:-&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;રાંતેજ ગામમાં ઘણા નાના મોટા જુના મંદિર છે એમાં શ્રી મહાકાલી માતાજી નું બાલસ્વરૂપમાં મંદિર પૌરાણિક છે.&amp;nbsp; એ સિવાય જૈન મંદિર ઐતિહાસિક છે જેની હું આજે વાત કરીશુ.&amp;nbsp;&lt;br /&gt;\r\nઇતિહાસ કહે છે કે વર્ષો પેહલા રાંતેજ ગામનું નામ રત્નાવતીનગરી નામે હતું. બાલબ્રહ્મચારી શ્રી નેમિનાથ ભગવાનનું ભવ્ય બાવન જિનાલય આશરે 500 વર્ષ પૂર્વે ધરતીમાં ઢંકાયેલું હતું. જેના પ્રાગટ્ય વિશે કહેવાય છે કે રાંતેજ પાસે ધનપુરા (કટોસણ) ગામનો શ્રાવક વેપાર ધંધા અર્થે દરરોજ રાંતેજ આવતો હતો. કયારેક તે રાંતેજ ગામમાં જ રાતવાસો કરતો હતો એક દિવસ ભરનિંદ્રામાં સુતેલા આ શ્રાવકને એક સ્વપ્નું આવ્યું કે આ ગામના ટેકરા ઉપર બાવાજીના મઢની નીચે ભવ્ય દેરાસર છે તેને તું બહાર કઢાવ. આવું સ્વપ્ન વારંવાર આવવા છતાંયે શ્રાવકે આ સ્વપ્ન ઉપર ધ્યાન આપ્યું નહીં.&lt;/p&gt;\r\n\r\n&lt;p&gt;એક દિવસ ફરીવાર અધિસ્થાક દેવે પ્રગટ થઇ નિંદ્રાધીન શ્રાવકને કહ્યું કે , હે શ્રાવક તું જિનમંદિર ને કેમ બહાર કઠાવતો નથી ? ત્યારબાદ શ્રાવકે સ્વપ્નમાં આવેલી હકીકતને ત્યાંના સંતને તથા કટોસણ દરબારને જણાવી. શ્રી સંત તથા દરબાર રૂબરૂ રાંતેજ આવી ને બાવાજીને સમજાવીને ટેકરાનું ઉત્ખનન કરાવ્યું. ખોદકામ કરાવતા જમીનમાંથી ગરિમામય કલાત્મક બાંધણીવાળું બાવન જિનાલય અખંડ સ્વરૂપે બહાર નીકળ્યું.&lt;/p&gt;\r\n\r\n&lt;p&gt;પરંતુ તેમાં એક પણ માતાજી ન જોવા મળતા બધા નિરાશ થયા તેથી આ શ્રાવકે દેરાસરમાં પ્રતિમા પ્રસ્થાપિત કરવા અથમતપની આરાધના કરી.&amp;nbsp; જે છેવટે ફળી અને દેવ પ્રગટ થયા અને શ્રાવક ને&amp;nbsp; કહ્યું કે પૂર્વ દિશામાં રબારીઓના ધરે એ જગ્યાએ ખોદકામ કરવાનું સૂચના આપી કહ્યું કે ત્યાં ખોદકામથી પ્રતિમા મળશે.&lt;/p&gt;\r\n\r\n&lt;p&gt;અધિસ્થાયક દેવની સૂચના પ્રમાણે ખોદકામ કરાવતાં સંપત્તિકાલીન 2200 વર્ષ પ્રાચીન આબેહૂબ મૂળનાયક શ્રી નેમિનાથ ભગવાન સહીત અઠાર પ્રતિમાઓ પ્રગટ થઇ. જે આજે પણ આ જિનાલયમા શોભે છે. જ્ઞાન દેનારી સરસ્વતીદેવી ની પ્રતિમા 750 વર્ષથી વધુ પ્રાચીન છે તો સાથે મહાલક્ષ્મીજી ,ખેત્રપાલદાદા પણ ઘણા પ્રાચીન છે.&lt;/p&gt;\r\n\r\n&lt;p&gt;પ્રતિમાઓ ઉપર તથા ભમતીમાં ના ભાગોમાં લખેલા લેખો આજે પણ વાંચી શકાય છે. જિનાલયનો જીર્ણોધાર 1100,1300,1600 તેમજ 1874માં થયાનું અનુભન છે. જેના ચમત્કાર ના પરચા ભક્તોને નજરે નિહાળ્યા છે એવા 650 વર્ષ પ્રાચીન માં સરસ્વતી આ તીર્થના અધિષ્ઠાત્રી છે. 18 સાંપ્રતકાલીન પરમાત્માઓએ આ તીર્થને સમૃદ્ધિનું શિખર સર કરાવ્યું છે તો પ્રાચીન અધિસ્થાન દેવોએ આ તીર્થનું ગૌરવ વધાર્યું છે.&lt;/p&gt;\r\n\r\n&lt;p&gt;શ્રી નેમિનાથ પ્રભુએ આ સૃષ્ટિ પર જન્મ ધારણ કર્યો એ દિવસ એટલે શ્રાવણ સુદ પાંચમ. જ્ઞાનની દેવી માં સરસ્વતી નો પ્રાગટ્ય દિવસ એટલે મહા સુદ પાંચમ અને તીર્થંકરો વડે પ્રરૂપિત જ્ઞાન આરાધનાનો દિવસ એટલે કારતક સુદ પાંચમ.&lt;/p&gt;\r\n\r\n&lt;p&gt;માહિતી સોર્સ : રાંતેજતીર્થ&lt;/p&gt;\r\n', 1),
(3, 66, '1564803997807.jpg', '&lt;p&gt;ચુવાળ પંથકનુ સર્વ કોમનુ શ્રધ્ધાકેન્દ્ર&lt;br /&gt;\n#શ્રી_ગૌતમેશ્વર_મહાદેવ_ઓઢવ...(૧)&lt;br /&gt;\n~~~~~~~~~~~~~~~~~~~&lt;br /&gt;\nઆશરે સોળસો વરસ જુનુને દેવસરતળાવના કિનારે આવેલુ દેવાધિદેવ મહાદેવનુ દેવાલય છે.શાતને રમણીયજગા મનને તનને પ્રફુલ્લિત કરે છે.&lt;/p&gt;\n\n&lt;p&gt;ઓઢવ ગામ સ્થિત આ સ્થળે પુરાણકાળમા ગૌતમેશ્વર રૂત્ષિએ તપ કરી આ મંદિરની સ્થાપના કરી હોવાનુ કહેવાય છે.&lt;/p&gt;\n\n&lt;p&gt;શ્રાવણ મહિનામા આ મંદિરે શ્રધ્ધાળુઓનુ ઘોડાપુર ઉમટે છે.આખા ય પંથકના લોકોનુ આસ્થા કેન્દ્ર છે.&lt;/p&gt;\n\n&lt;p&gt;અગાઉના સમયમા આ મંદિર અવિકસીત અવસ્થામા હતુ.કોલાદ ગામનાને આવિસ્તારના પ્રખ્યાત રબારી જ્ઞાતિના શ્રી રામજી ભગત અને ગામલોકોએ મંદિરના વિકાસમા સક્રિય રસ લઇ આજનુપરિસર બનાવેલ છે.સંવત ર૦૨૭મામહારૂદ્ર યજ્ઞનુ ભવ્ય આયોજન પણ કરેલ ...&lt;/p&gt;\n\n&lt;p&gt;આ પરિસરમા શ્રી ગણેશજી, શ્રી હનુમાનજી મહારાજ અને ગોગા મહારાજના મંદિરો પણ સ્થાપિત છે.&lt;/p&gt;\n\n&lt;p&gt;ગામના મોટા પ્રસંગો,લગ્નો,ધાર્મિક કાર્યક્રમો કરી શકાય તેવી સગવડો પણ ઉભી કરવામા આવેલ છે.મંદિર પરિસરમા સંકુલમા શિક્ષણ માટે હાઈસ્કુલ પણ છે.&lt;/p&gt;\n\n&lt;p&gt;શ્રાવણ મહિનાના દર સોમવારે શ્રધ્ધાળુઓનો મેળો ભરાય છે.&lt;/p&gt;\n\n&lt;p&gt;કહેવાય છે કે કાશીના જ્યોતિર્લીગ મહાદેવ કાશી વિશ્વનાથ મહાદેવમા પણ આરતી વખતે શ્રી ઓઢવીયા મહાદેવની જય બોલાય છે.&lt;br /&gt;\nએકવાર અવશ્ય આ પવિત્ર ધામની મુલાકાત લેવા જેવી છે.&lt;br /&gt;\nપોસ્ટ:-#પોપટભાઈ_પટેલ_ઘેલડા...&lt;/p&gt;\n', 1);
